--listing changes
SELECT TOP 3000 
  S.SpcRecID, L.LegListing, L.LegDateListed, C.CtyRecID, L.LegNotes
FROM ORWELL.plants.dbo.species AS S
  INNER JOIN ORWELL.plants.dbo.genus AS G ON S.SpcGenRecID = G.GenRecID 
  INNER JOIN ORWELL.plants.dbo.family AS F ON G.GenFamRecID = F.FamRecID 
  INNER JOIN ORWELL.plants.dbo.legal AS L ON S.SpcRecID = L.LegSpcRecID
  INNER JOIN ORWELL.plants.dbo.legalname AS LN ON L.LegLnmRecID = LN.LnmRecID AND LN.LnmRecID = 3
  INNER JOIN ORWELL.animals.dbo.Country as C ON L.LegISO2 = C.CtyISO2-- OR L.LegISO2 IS NULL
WHERE S.SpcStatus = 'A' AND LN.LnmRecID = 3
ORDER BY F.FamRecID, G.GenRecID;

-- taxon_concepts
Select 'Plantae' as Kingdom , 
--P.PhyName, C.ClaName, 
O.OrdName, F.FamName, G.GenName, S.SpcName, S.SpcInfraRank, S.SpcInfraRank, S.SpcInfraEpithet, S.SpcRecID, S.SpcStatus
